import PropTypes from "prop-types";

const Header = ({ title }) => {
  return (
    <div>
      <header className="header">
        <h1>{title}</h1>
      </header>
      <button className="btn">Add</button>
    </div>
  );
};

Header.defaultProps = {
  title: "Task Tracker for Reals",
};

Header.propTypes = {
  title: PropTypes.string,
};

